import {
  Timeline,
  Content,
  ContentYear,
  ContentBody,
  Description
} from "vertical-timeline-component-react";

const TimelinePage = () => (
  <Timeline>
    <Content>
      <ContentYear year="2018" />
      <ContentBody title="Amazing Title">
        <Description
          text="I'm an amazing event"
          optional="I'm an amazing optional text"
        />
      </ContentBody>
    </Content>
    <Content>...</Content>
  </Timeline>
);

export default TimelinePage;
